import React from "react";
import Sidebar from "./components/Sidebar";
import Navbar from "./components/Navbar";
import Dashboard from "./pages/Dashboard";

function App() {
  return (
    <div style={{ display: 'flex', backgroundColor: '#0f172a' }}>
      <Sidebar />
      <div style={{ flex: 1 }}>
        <Navbar />
        <Dashboard />
      </div>
    </div>
  );
}

export default App;
